According to Sartre, man has to realize his freedom with his own decisions and choices. Existentialism, on the other hand, is an optimistic philosophy and is essentially humanistic. Humanism is an important aspect in Sartre's philosophy.

Realizing one's own freedom through actions can be seen as a trip through life, and one should overcome each and every obstacle in their own way.
